           {/* <a href={props.prod} target="blank"> <i class="fas fa-link fa-md fa-2x"></i></a> */}
           {/* <a href={props.video}> <i class="fas fa-video fa-md"></i></a> */}
          {/* </div> */}
        </div>
      </div>
    </div>
  );
}

export default ProjectCard;
